@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:AuthorizationProcess
    a owl:Class ;
    rdfs:subClassOf [
        a owl:Restriction ;
        owl:onProperty atm:receivesAcceptanceFrom ;
        owl:someValuesFrom atm:BankComputer
    ] .

atm:ValidPassword
    a owl:Class ;
    rdfs:subClassOf [
        a owl:Restriction ;
        owl:onProperty atm:hasPassword ;
        owl:someValuesFrom atm:Password
    ] .

atm:ValidSerialNumber
    a owl:Class ;
    rdfs:subClassOf [
        a owl:Restriction ;
        owl:onProperty atm:hasSerialNumber ;
        owl:someValuesFrom atm:SerialNumber
    ] .

atm:TransactionDialog
    a owl:Class ;
    rdfs:subClassOf [
        a owl:Restriction ;
        owl:onProperty atm:isStartedBy ;
        owl:someValuesFrom [
            a owl:Class ;
            owl:intersectionOf (
                atm:AuthorizationProcess
                atm:ValidPassword
                atm:ValidSerialNumber
            )
        ]
    ] .
